import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      counter: 0,
    };
  }
  render() {
    const { counter } = this.state;
    return (
      <div className="App" data-test="component-app">
        <h1>
          The counter is currently is {counter}
        </h1>
        <button id="increment" onClick={() => this.setState({ counter: counter + 1})}>Increment counter</button>
      </div>
    );
  }
}

export default App;
